import React, { Component, Fragment, useEffect, useState } from "react";
import styled from "styled-components";
import { SURVEY_DATA } from "../../config";
import { flexCenter } from "../../styles/CommonStyle";

const Survey = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch(SURVEY_DATA)
      .then((res) => res.json())
      .then((res) => setData(res.survey));
  }, []);

  console.log(data);
  return (
    <Fragment>
      <WrapSurvey>
        <Header>
          <span>핵심 능력 테스트</span>
          <span>/{data.length}</span>
        </Header>
        <WrapMain>
          <Question>
            <h1>
              <div className="emphasis">자유시간</div>이 있을때 나는
            </h1>
          </Question>
          <Answer>
            <div className="answer">오늘도 개미는 일을 하지요</div>
            <p>vs</p>
            <div className="answer">잇테익스 투 두 탱고 탱고 망고 망고d</div>
          </Answer>
        </WrapMain>
      </WrapSurvey>
    </Fragment>
  );
};

export default Survey;

const WrapSurvey = styled.section`
  ${flexCenter};
  flex-direction: column;
`;

const Header = styled.section`
  display: flex;
  justify-content: space-between;
  width: 360px;
  padding: 170px 24px 0 24px;
  color: rgba(0, 0, 0, 0.4);
  font-size: 15px;
`;

const WrapMain = styled.section`
  padding-top: 100px;
`;

const Question = styled.div`
  text-align: center;
  font-size: 30px;
`;

const Answer = styled.div`
  ${flexCenter};
  flex-direction: column;
  padding-top: 100px;
  font-size: 18px;

  .answer {
    border: 1px solid rgba(0, 0, 0, 0.4);
    border-radius: 10px;
    padding: 24px;
  }
`;
